import React from 'react';
import './ChatroomList.css';

const SUBJECTS = {
  Podstawa: ['Matematyka', 'Fizyka', 'Chemia', 'Informatyka', 'Biologia', 'Historia', 'Język polski', 'Język angielski','Wiedza o społeczeństwie','Język Niemiecki', 'Język hiszpański', 'Geografia'],
  Rozszerzenie: ['Matematyka', 'Fizyka', 'Chemia', 'Informatyka', 'Biologia', 'Historia', 'Język polski', 'Język angielski','Wiedza o społeczeństwie','Język Niemiecki', 'Język hiszpański', 'Geografia'],
};

export default function ChatroomList({ level, setLevel, setSelectedRoom }) {
  return (
    <div className="chatroom-list-wrapper">

      <h2>Chatroomy ({level}):</h2>
      <div className="cards">
        {SUBJECTS[level].map((subject) => (
          <div
            key={subject}
            className="card"
            onClick={() => setSelectedRoom(subject)}
          >
            {subject}
          </div>
        ))}
      </div>
    </div>
  );
}
